const Projetos = () => {
  const projetos = [
    {
      id: 1,
      titulo: "Landing Page (TypeScript)",
      desc: "P√°gina moderna feita em React + TypeScript.",
      img: "/projetos/landing-page-ts.png",
      link: "URL_DO_REPO_1"
    },
    {
      id: 2,
      titulo: "Furniro E-commerce",
      desc: "Frontend com React TS e backend com NestJS + PostgreSQL.",
      img: "/projetos/furniro.png",
      link: "URL_DO_REPO_2"
    },
    {
      id: 3,
      titulo: "Petshop",
      desc: "Site em HTML, CSS e JavaScript.",
      img: "/projetos/petshop.png",
      link: "URL_DO_REPO_3"
    },
    {
      id: 4,
      titulo: "Mr. Zeus",
      desc: "Landing page desenvolvida em React + TypeScript.",
      img: "/projetos/mrzeus.png",
      link: "URL_DO_REPO_4"
    },
  ];

  return (
    <section className="card-section">
      <h2 className="card-title">Projetos</h2>

      <div className="card-container">
        {projetos.map((p) => (
          <div key={p.id} className="card">
            <img src={p.img} alt={p.titulo} className="card-img" />

            <div className="card-content">
              <h3>{p.titulo}</h3>
              <p>{p.desc}</p>

              <a href={p.link} target="_blank" rel="noopener noreferrer">
                <button className="card-btn">
                  üëÅÔ∏è Ver Projeto
                </button>
              </a>
            </div>

            <div className="card-footer">
              <span>{p.titulo}</span>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projetos;
